import React from "react";
import "../styles/PostSender.css";
import AddToPhotosIcon from "@material-ui/icons/AddToPhotos";

const PostSender = () => {
  return (
    <div className="postsender">
      <div>
        <input type="text" />
        <AddToPhotosIcon
          style={{
            padding: "10px",
            fontSize: "40px",
            color:"#dbd3d3;",
          }}
        />
      </div>
    </div>
  );
};

export default PostSender;
